// client/src/routes/Home.js
import React from 'react';
import '../App.css';

function Home() {
  return (
    <div className='home'>
      <div className='login'>
        <button onClick={Login}>Login</button>
      </div>
      <h1>Welcome to the Home Page</h1>
    </div>
  );
}

export default Home;
